import React from "react";

import '../Css/BotonColRND.css';

function BotonColRND( texto) {
  return(
    <div>
      <label
        style={{color : `${colorRND}`}}>
          {texto}
      </label>
      <button
        className="btnColorRND"
        onClick={colorRND}>
        Cambiar Color
      </button>
    </div>
  );
};

export default BotonColRND;
